begin
   execute immediate 'create table set_staging_tab(collection_id NUMBER, element_id NUMBER)';
exception
when others then
   execute immediate 'drop table set_staging_tab';
   execute immediate 'create table set_staging_tab(collection_id NUMBER, element_id NUMBER)';
end;
/
   


begin
   --simplified object type
   execute immediate 'CREATE OR REPLACE TYPE set_obj FORCE AS OBJECT (elementid NUMBER)';
